import React from "react";

const Leaguetable = ({ data }) => {
  console.log(data);
  return (
    <>
      {data.map((item) => {
        return <h1 className="text-black">{item.Position}</h1>;
      })}
      ;
    </>
  );
};

export default Leaguetable;
